import './App.css';

const SearchBar = (props)=>{
  return(
    <>
      <h1>Name: {props.name}</h1>
    </>
  )
}

function App() {
  return (
    <div className="App">
      <SearchBar name="Harry"/>
    </div>
  );
}

export default App;
